window.bookSummaryJSON = "<p>They say your first kiss should be earned. <br> Mine was stolen by a devil in a masquerade mask under the black Chicago sky. <br> They say the vows you take on your wedding day are sacred. <br> Mine were broken before we left church. <br> They say your heart only beats for one man. <br> Mine split and bled for two rivals who fought for it until the bitter end. <br> I was promised to Angelo Bandini, the heir to one of the most powerful families in the Chicago Outfit. <br> Then taken by Senator Wolfe Keaton, who held my fatherâ€™s sins over his head to force me into marriage. </p> <p>They say that all great love stories have a happy ending. <br> I, Francesca Rossi, found myself erasing and rewriting mine until the very last chapter. <br> One kiss. <br> Two men. <br> Three lives. <br> Entwined together. </p> <p>And somewhere between these two men, I had to find my forever.</p>"; 
